import React from "react";
import MenuIcon from "@material-ui/icons/Menu";
import MenuButton from "./MenuButton";
import { makeStyles } from "@material-ui/core/styles";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import AboutYourSelf from "./AboutYourSelf";
import LearnOnline from "./LearnOnline";

const useStyles = makeStyles(() => ({
  menuicon: {
    paddingRight: "18rem",
  },
  about: {
    paddingRight: "50rem",
    color: "blue",
  },
}));
export default function Home() {
  const classes = useStyles();
  return (
    <>
      <Router>
        <div>
          <MenuIcon className={classes.menuicon} />
          <Link to="/aboutyourself">
            <MenuButton name="About Your Self" className={classes.about} />
          </Link>
          <MenuButton
            name="Online Counselling"
            className={classes.counselling}
          />
          <Link to="/scholarship">
            <MenuButton name="Scholarship" />
          </Link>
          <Link to="/learnonline">
            <MenuButton name="Learn Online" />
          </Link>

          <MenuButton name="Info Videos" />
          <MenuButton name="My Courses" />
          <MenuButton name="Live Interaction Class" />
          <Switch>
            <Route path="/aboutyourself">
              <AboutYourSelf />
            </Route>
            <Route path="/scholarship">
              <Scholarship />
            </Route>
            <Route path="/learnonline">
              <LearnOnline />
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  );
}
